const Speakers = () => {
    return (
        <div>
            {speakers.map((imageSrc, name) => {
                return <img src={`images/${imageSrc}.png`} key={imageSrc} alt={name}/>;
            })}
        </div>
    );
}

const EnhancedSpeakerComponent = withData(Speakers);

